// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';
import App from './App';
import Register from "./register"

function Registration() {
  return (
    <Router>
    <Routes></Routes>
    <Route path="/" element={<Register />} />
    </Router>
  );
}

export default App;
